import React, { useEffect } from 'react';
import { Paper, Typography, CircularProgress, Divider, CardActions } from '@material-ui/core/';
import { useDispatch, useSelector } from 'react-redux';
import moment from 'moment';
import { useParams, useHistory } from 'react-router-dom';

import { getPost, getPostsBySearch } from '../../actions/posts';
import useStyles from './styles';

const Post = () => {
  const user = JSON.parse(localStorage.getItem('profile'));

  const { pelanggan, posts, isLoading } = useSelector((state) => state.posts);
  const dispatch = useDispatch();
  const history = useHistory();
  const classes = useStyles();
  const { id } = useParams();

  useEffect(() => {
    dispatch(getPost(id));
    console.log(id, "ini id");
  }, [id]);

  useEffect(() => {
    console.log(pelanggan, 'posstt');
    if (pelanggan) {
      dispatch(getPostsBySearch({ search: 'none' }));
    }
  }, [pelanggan]);

  if (!pelanggan) return null;


  if (isLoading) {
    return (
      <Paper elevation={6} className={classes.loadingPaper}>
        <CircularProgress size="7em" />
      </Paper>
    );
  }


  return (
    <Paper style={{ padding: '20px', borderRadius: '15px' }} elevation={6}>
      <div className={classes.card}>
        <div className={classes.section}>
          <Typography variant="h3" component="h2">{pelanggan.namaPelanggan}</Typography>
          <Typography gutterBottom variant="subtitle1" color="inherit" component="h2">{pelanggan.noPelanggan}</Typography>
          <Divider style={{ margin: '20px 0' }} />
          <CardActions className={classes.cardActions} >
            <Typography variant="subtitle1" color="inherit">Slot:  {pelanggan.noSlot}</Typography>
            <Divider orientation="vertical" flexItem />
            <Typography variant="subtitle1" color="inherit">{pelanggan.statusKendaraan}</Typography>
          </CardActions>
          <Divider style={{ margin: '20px 0' }} />
          <Typography variant="body1">{moment(pelanggan.createdAt).fromNow()}</Typography>
          <Divider style={{ margin: '20px 0' }} />
          <CardActions className={classes.cardActions} >
            <Typography variant="subtitle1" color="inherit">{pelanggan.merkMotor}</Typography>
            <Divider orientation="vertical" flexItem />
            {(user?.result?._id === pelanggan?.creator || user?.result?._id === "62729e1306510726d49b02a2") && (
              <Typography variant="subtitle1" color="inherit">{pelanggan.plat}</Typography>
            )}
          </CardActions>
          <Divider style={{ margin: '20px 0' }} />
          <CardActions className={classes.cardActions} >
            <Typography variant="h6" color="inherit">Pencuci {pelanggan.namaPencuci}</Typography>
            <Divider orientation="vertical" flexItem />
            <Typography variant="subtitle1" color="inherit">Rp.10.000</Typography>
          </CardActions>
          <Divider style={{ margin: '20px 0' }} />
          <Typography variant="h6">Created by: {pelanggan.name}</Typography>
          <Divider style={{ margin: '20px 0' }} />
        </div>
        <div className={classes.imageSection}>
          <img className={classes.media} src={pelanggan.selectedFile} alt={pelanggan.namaPelanggan} />
        </div>
      </div>
    </Paper>
  );
};

export default Post;
